    }

    function unFocusCard(e) {
        e.currentTarget.classList.remove("focused")
    }

    return (
        <Link to={`/operators/${name.toLowerCase()}`}>
            <div className="OperatorCardSmall">

            </div>
        </Link>
    )
}
